import { Header } from "../../components/Header";
import background from "../../assets/background.png";

import "./styles.css";
function App() {
  return (
    <div className="App">
      <Header />
      <div className="conteudo">
        <img src={background} className="background" alt="background app" />
        <div className="info">
          <div>
            <input name="usuario" placeholder="@username" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
